import { configureStore } from '@reduxjs/toolkit';

import mediaStore from './mediaStore';
import settingStyle from './settingStyle';

const store = configureStore({
  reducer: {
    settingStyle: settingStyle,
    mediaStore,
    user
  },
});

export default store;
